import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

export default function DetailPage() {
  const [waterBrands, setWaterBrands] = useState([]);
  useEffect(() => {
    axios.get("http://3.39.164.17:8000/waterbrand/").then((response) => {
      setWaterBrands(response.data);
    });
  }, []);

  let params = useParams();

  let waterBrandId = params.waterBrandId - 1;

  let waterBrand = waterBrands[waterBrandId];

  console.log(waterBrand);

  console.log(waterBrand.name);
  return (
    <>
      <h1>디테일 만드는 중 ㅜㅅㅜ</h1>
      <h2>외않되</h2>
      <h3>{waterBrand.name}</h3>
    </>
  );
}
